@application.route("/get_my_ip", methods=["GET"])
def get_my_ip():
	fwd = request.environ.get('HTTP_X_FORWARDED_FOR', None)
	if fwd is None:
		fwd = request.environ.get('REMOTE_ADDR')
	ip = fwd.split(',')[0]
	if request.args.get('format') == 'json':
		return jsonify(**{'ip': ip})
	else:
		return ip


